def possibleToStamp(grid, stampHeight: int, stampWidth: int) -> bool:
    m, n = len(grid), len(grid[0])
    prefixrows = [[0 for _ in range(n + 1)] for __ in range(m + 1)]
    prefixcols = [[0 for _ in range(n + 1)] for __ in range(m + 1)]
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if j == 1:
                prefixrows[i][j] = grid[i - 1][j - 1]
            else:
                prefixrows[i][j] = prefixrows[i][j - 1] + grid[i - 1][j - 1]

    for i in range(1, n + 1):
        for j in range(1, m + 1):
            if j == 1:
                prefixcols[j][i] = grid[j - 1][i - 1]
            else:
                prefixcols[j][i] = prefixcols[j - 1][i] + grid[j - 1][i - 1]

    # print(prefixwidth, m, n)
    # debug("prefixrows", prefixrows)
    # print()
    # for i in prefixrows:
    #     print(i)
    # print()
    # for i in prefixcols:
    #     print(i)
    ok = True
    """
    conditions:
    1. cover all empty cells
    2. do not cover occupied cells
    3. stamps can overlap
    4. stamps must stay completely inside the grid
    """
    tot = [[False for _ in range(n + 1)] for __ in range(m + 1)]

    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if not grid[i-1][j-1]:
                if j + stampWidth - 1 <= n :
                    x = prefixrows[i][j + stampWidth - 1] - prefixrows[i][j - 1] # number of 1's in b/w , so we want atleast 1
                    if x != 0:
                        ok = False
                        break
                else:
                    ok = False
                    break

        if not ok :
            break

    for i in range(1 , n + 1):
        for j in range(1 , m + 1):
            if not grid[j-1][i-1] :
                if j + stampHeight - 1 <= m :

                    x = prefixcols[j + stampHeight-1][i] - prefixcols[j-1][i] # number of 1's in b/w , so we want atleast 1
                    if x != 0 :
                        ok = False
                        break
                else:
                    ok = False
                    break

        if not ok :
            break


    return ok





